import React from "react";
import { TimeSvg } from "../../../../components/Icons/TimeSvg";
import styles from "./DestinationMenu.module.scss";

const DestinationMenu = () => {
  return (
    <div className={styles.container}>
      <div className={styles.leftContent}>
        <span className={styles.title}>Recherches récentes</span>
        <ul className={styles.recentsList}>
          <li className={styles.listItem}>
            <div className={styles.imgContainer}>
              <TimeSvg width={20} height={20} />
            </div>
            <div className={styles.contentContainer}>
              <span className={styles.titleContent}>Afrique - Logement</span>
              <span className={styles.subTitle}>15-17 août - 2 voyageurs</span>
            </div>
          </li>
        </ul>
      </div>
      <div className={styles.rightContent}>
        <span className={styles.title}>Rechercher par région</span>
        <ul className={styles.countriesList}></ul>
      </div>
    </div>
  );
};

export default DestinationMenu;
